import React from 'react';
import './form-button.style.scss';

const FormButton = ({ children, isGoogleSignIn, ...otherProps }) => {
    return (
        <div className={`${{isGogg}}`} {...otherProps}>
            {children}
        </div>
    );
}

export default FormButton;
